RapiX is a simple solution for exchanging personal data for companies, individuals and groups. Create and manage appropriate profiles for each life situation: work, personal, VIP, hobby, etc.
Share your profiles remotely or in person; your contact’s information is automatically updated as soon as they change phone numbers, work, photo, etc .; send emails, SMS or call your contacts through the application.
• Create multiple profiles;
• Find contacts in the proximity;
• Share your profiles and contacts instantly;
• Get updates from your contacts;
• Add photos and various information to enrich your profiles;
• Call, send emails and SMS to your contacts through the application;
• RapiX uses your internet connection (4G / 3G / 2G / EDGE or Wi-Fi, when available).

Why to use RapiX?
• Economy : Do not spend money on making and printing paper business cards.
• Time: Don’t  waste your time searching for a specific business card from several of your collection. With RapiX, locate any contact immediately and ensure that the contact’s information is always up-to-date.
• Availability : RapiX will always be with you and you’ll always have an appropriate virtual card for your clients, friends and / or colleagues.
• Efficiency : Share the appropriate personal or professional information for each situation in your life. The information contained in RapiX virtual cards is much more complete than any paper business card can contain.
• Usefulness : The professional information you share with your potential customers through RapiX can be easily accessed at any time - unlike paper cards, most of which are lost or forgotten shortly thereafter.
• Modernity: welcome to the new way of sharing personal data between individuals or groups of people using just one click - stop spending your valuable time and eliminate phone numbers and contact data typos.
• Environment: join the international community of people who care about the future of our planet, avoiding the unnecessary waste of millions of tons of paper, plastics and magnets used to spread contact between people and companies. Get started with RapiX now!
RapiX is more than an information exchange application: it's a new way of life.

Terhubung dengan seluruh Alumni Universitas Indonesia dalam satu aplikasi.

UI Connect adalah sebuah platform media sosial yang disediakan khusus bagi seluruh Alumni UI yang bertujuan sebagai wadah interaksi digital antar Alumni UI. Adanya aplikasi UI Connect ini diharapkan dapat meningkatkan kualitas hubungan antar Alumni UI secara personal dan profesional.

Aplikasi UI Connect ini diperuntukkan khusus untuk Alumni UI dan Aplikasi UI Connect akan melakukan verifikasi keaslian status Alumni Anda sebelum Anda bisa menggunakan aplikasi ini.

Pembaruan pada Aplikasi UI Connect versi 1.2.7:
1. Membuat kiriman status, tulisan, agenda/acara, mencari mitra;
2. Mendapatkan kabar dan bertukar pengalaman dengan alumni lainnya;
3. Menemukan acara/aktivitas yang diadakan oleh sesama Alumni UI;
4. Mengetahui daftar Alumni Universitas lintas fakultas, jurusan dan angkatan;
5. Memverifikasi data Alumni Anda;
6. Fitur promo reward dengan sistem menukarkan kupon reward secara offline pada merchant yang telah bekerjasama;
7. Fitur notifikasi, membuat Anda tetap mendapatkan informasi dari seluruh aktivitas kiriman Anda;
8. Fitur respon Agenda dan Mitra, membuat pengguna lain dapat memberikan konfirmasi kehadiran pada Agenda yang Anda kirim atau memberikan konfirmasi adanya minat pada kiriman Mitra yang Anda buat;
9. Fitur Agenda Saya, membuat seluruh kegiatan yang telah Anda konfirmasi kehadirannya terrangkum dalam satu menu.
10. Fitur Minat, memungkinkan Anda untuk dapat memilih topik minat dan melihat kiriman-kiriman Alumni dengan minat yang sama terlebih dahulu;
11. Fitur Edit profil, membuat Anda dapat mengubah data diri, pendidikan dan pengalaman kerja Anda;
12. Fitur pengaturan, membuat Anda dapat mengatur visibilitas privasi pada informasi kontak pada profil Anda;
13. Fitur Ubah Password, memungkinkan Anda untuk mengubah password akun UI Connect Anda.


Ayo segera terhubung dan jadilah hebat dengan UI Connect!


Aplikasi UI Connect dikembangkan oleh Tim dari ILUNI UI.


